import { Link } from "react-router-dom";


function ProductsPage(){
    return (
    <>
    <h1>여기는 제품들이 보여지는 페이지입니다.</h1>
        <ul>
            <li><Link to="/products/product-1">제품1</Link></li>
            <li><Link to="/products/product-2">제품2</Link></li>
            <li><Link to="/products/product-3">제품3</Link></li>
        </ul>

    <p>
     메인 페이지로<Link to="/">이동</Link>
    </p>
    </>
    )
}

export default ProductsPage;
